function deleteImage(img) {
    
    swal({
        html: true,
        title: "Hapus fail imej " + img + "?",
        text: "Fail ini akan dihapuskan secara kekal di pelayan!",
        //type: "warning",
        imageUrl: '../../images/staf/' + img.replace(/ /g, '%20'),
        showCancelButton: true,
        confirmButtonColor: "#DD6B55",
        confirmButtonText: "HAPUS FAIL!",
        cancelButtonText: "BATAL",
        closeOnConfirm: false,
        closeOnCancel: false,
        showLoaderOnConfirm: true
    }, function (isConfirm) {
        if (isConfirm) {

            $.ajax({
                type: "get",
                url: "./del_gambar/" + img,
                //data: "img=" + img,
                success: function (data) { }
            }).done(function (data) {
                swal("HAPUS!", "Fail imej " + img + " berjaya dihapuskan.", "success");
                $("#tblSenaraiGambar").DataTable().ajax.reload();
            }).error(function (data) {
                swal("Oops", "We couldn't connect to the server!", "error");
            });

        } else {
            swal("BATAL", "Operasi hapus fail imej " + img + " dibatalkan.", "error");
        }
    });
    
}
